import React, { Component } from "react";

class Title extends Component {
  render() {
    return (
      <div className={"row"}>
        <h1 className={"ml-5 mt-4 b"}>Robots </h1>
        <button className={"btn btn-primary btn-sm "}>
          Add Robot
        </button>
      </div>
    );
  }
}

export default Title;
